static const char __pyx_k_Cythonized_version_of_the_py_cl[] = "\n    Cythonized version of the :py:class:`sparseOutrankingDigraphs.PreRankedOutrankingDigraph` class for the multiprocessing implementation of multiple criteria quantiles ranking of very big performance tableaux - > 100000.\n\n    *Parameters*:\n        * argPerfTab, a cPerformanceTableau object or a file name of such a stored object,\n        * quantiles=4, higher values may give more convincing ranking results.\n        * quantilesOrderingStrategy= {\"optimal\" (default) | 'average'},\n        * LowerClosed=False,\n        * componentRankingRule={'Copeland' (default) | 'NetFlows' },\n        * minimalComponentSize=1, higher values my result in lower run times and better ranking results,\n        * Threading=False,\n        * startMethod={ 'spawn' (default) | 'forkserver' | 'fork' },\n        * tempDir= './' by default,\n        * nbrOfCPUs= cpu_count() by default,\n        * save2File=None: allows to save a short object description,\n        * CopyPerfTab=False: If *True* allows to show coloured performance heatmaps of the ranking results,\n        * Comments=False,\n        * Debug=False.\n\n    \n    By default, the number of quantiles q is set to quartiles. However, the ranking quality gets better with a finer grained quantiles decomposition. \n    \n    For other parameters settings, see the corresponding :py:class:`sparseOutrankingDigraphs.PreRankedOutrankingDigraph` class.\n\n    Example python3.12 session:\n\n    >>> from cRandPerfTabs import *\n    >>> tp = cRandomCBPerformanceTableau(numberOfActions=1000,\n    ...                     Threading=True,seed=100)\n    >>> tp\n    *------- PerformanceTableau instance description ------*\n    Instance class   : RandomCBPerformanceTableau\n    Instance name    : randomCBperftab\n    # Actions        : 1000\n    # Objectives     : 2\n    # Criteria       : 7\n    Attributes       : ['name', 'randomSeed', 'actions', 'objectives', \n                        'criteriaWeightMode', 'criteria', 'evaluation', \n         ""               'weightPreorder']\n    >>> from cSparseIntegerOutrankingDigraphs import *\n    >>> bg = cQuantilesRankingDigraph(tp,quantiles=5,\n    ...                  quantilesOrderingStrategy='optimal',\n    ...                  LowerClosed=False,\n    ...                  minimalComponentSize=10,\n    ...                  Threading=True,nbrOfCPUs=8,Debug=False)\n    >>> bg\n      *----- Object instance description --------------*\n      Instance class    : cQuantilesRankingDigraph\n      Instance name     : randomCBperftab_mp\n      # Actions         : 1000\n      # Criteria        : 7\n      Sorting by        : 5-Tiling\n      Ordering strategy : average\n      Ranking rule      : Copeland\n      # Components      : 80\n      Minimal order     : 10\n      Maximal order     : 24\n      Average order     : 12.5\n      fill rate         : 1.230%\n      Attributes       : ['runTimes', 'name', 'actions', 'order',\n                          'dimension', 'sortingParameters', 'nbrOfCPUs',\n                          'valuationdomain', 'profiles', 'categories',\n                          'sorting', 'minimalComponentSize', 'decomposition',\n                          'nbrComponents', 'nd', 'startMethod', 'nbrThreads',\n                          'components', 'fillRate', 'maximalComponentSize',\n                          'componentRankingRule', 'boostedRanking']\n      ----  Constructor run times (in sec.) ----\n      Nbr of threads    : 8\n      StartMethod       : spawn\n      Total time        : 0.17755\n      QuantilesSorting  : 0.03014\n      Preordering       : 0.00157\n      Decomposing       : 0.14579\n    >>> print(bg.boostedRanking[:10],' ... ',bg.boostedRanking[-10:] )\n       [680, 389, 742, 152, 132, 717, 276, 604, 624, 181]\n          ...\n       [203, 879, 33, 681, 63, 550, 860, 770, 925, 313]  \n    \n    ";
