static const char __pyx_k_Parameters_argPerfTab_a_cPerfor[] = "\n    *Parameters*:\n        * argPerfTab, a *cPerformanceTableau* object or a file name of such a stored object,\n        * quantiles=4, higher values may give more convincing ranking results,\n        * quantilesOrderingStrategy={ \"average\" (default) | 'optimal' },\n        * LowerClosed=False,\n        * componentRankingRule= { \"Copeland\" (default) | 'NetFlows' },\n        * minimalComponentSize=1, higher values my result in lower run times and better ranking results,\n        * Threading=False,\n        * startMethod= {'spawn' (default) | 'forkserver' | 'fork' }\n        * tempDir= './' by default,\n        * nbrOfCPUs= cpu_count by default,\n        * save2File=None, fileName where to permanently store a short description of the resulting *SparseIntegerOutrankingDigraph* object (for batch experiments on HPC platforms),\n        * CopyPerfTab=False, If *True* allows to print out performance heatmaps of the preranking result,\n        * Comments=False,\n        * Debug=False.\n\n    Main class for the multiprocessing implementation of big outranking digraphs.\n    \n    The big outranking digraph instance is decomposed with a q-tiling sort into a partition\n    of quantile equivalence classes which are linearly ordered by average quantile limits (default).\n\n    With each quantile equivalence class is associated a BipolarOutrankingDigraph object\n    which is restricted to the decision actions gathered in this quantile equivalence class.\n\n    By default, the number of quantiles q is set to quartiles. However, the ranking quality and the best choice results get better with a finer grained quantiles decomposition. \n    \n    For other parameters settings, see the corresponding :py:class:`sortingDigraphs.QuantilesSortingDigraph` class.\n\n    Example python3.11 session:\n\n    >>> from cRandPerfTabs import *\n    >>> tp = cRandomCBPerformanceTableau(numberOfActions=1000,\n    ...                           Threading=True,seed=100)\n    >>> tp\n    *------- Pe""rformanceTableau instance description ------*\n    Instance class   : cRandomCBPerformanceTableau\n    Seed             : 100\n    Instance name    : randomCBperftab\n    # Actions        : 1000\n    # Objectives     : 2\n    # Criteria       : 7\n    Attributes       : ['name', 'randomSeed', 'actions', 'objectives', \n                        'criteriaWeightMode', 'criteria', \n                        'evaluation', 'weightPreorder']\n    >>> from cSparseIntegerOutrankingDigraphs import *\n    >>> bg = SparseIntegerOutrankingDigraph(tp,quantiles=5,\n    ...                       quantilesOrderingStrategy='average',\n    ...                       LowerClosed=False,\n    ...                       minimalComponentSize=10,\n    ...                       Threading=True,nbrOfCPUs=12,\n    ...                       startMethod='spawn', \n    ...                       Debug=False)\n    >>> bg\n     *----- Object instance description --------------*\n      Instance class    : SparseIntegerOutrankingDigraph\n      Instance name     : randomCBperftab_mp\n      # Actions         : 1000\n      # Criteria        : 7\n      Sorting by        : 5-Tiling\n      Ordering strategy : average\n      Ranking rule      : Copeland\n      # Components      : 10\n      Minimal order     : 10\n      Maximal order     : 438\n      Average order     : 100.0\n      fill rate         : 26.541%\n      Attributes       : ['runTimes', 'name', 'actions', 'criteria', \n                          'evaluation', 'order', 'dimension', \n                          'sortingParameters', 'nbrOfCPUs', 'valuationdomain', \n                          'profiles', 'categories', 'sorting', \n                          'minimalComponentSize', 'decomposition', \n                          'nbrComponents', 'nd', 'components', 'fillRate', \n                          'maximalComponentSize', 'componentRankingRule', \n                          'boostedRanking']\n     ----  Constructor run times (in sec.) ----\n      Threads    ""       : 12\n      StartMethod       : spawn\n      Total time        : 2.33468\n      QuantilesSorting  : 0.02812\n      Preordering       : 0.00126\n      Decomposing       : 2.30525\n      Ordering          : 0.00001\n    >>> bg.showBestChoiceRecommendation()\n      ***********************\n      * --- Best choice recommendation(s) ---*\n      (in decreasing order of determinateness)   \n      Credibility domain:  {'min': -24, 'med': 0, 'max': 24, \n                            'hasIntegerValuation': True}\n      * choice              : [132, 152, 680, 742]\n        independence        : 0.00\n        dominance           : 2.00\n        absorbency          : -10.00\n        covering (%)        : 55.56\n        determinateness (%) : 51.60\n        - most credible action(s) = { '680': 1.00, '132': 1.00, }\n      ***********************\n      * --- Worst choice recommendation(s) ---*\n      (in decreasing order of determinateness)   \n      Credibility domain:  {'min': -24, 'med': 0, 'max': 24, \n                            'hasIntegerValuation': True}\n      * choice              : [203, 313, 474, 970, 994]\n      independence        : 0.00\n      dominance           : -18.00\n      absorbency          : 2.00\n      covering (%)        : 3.10\n      determinateness (%) : 50.0\n      - most credible action(s) = {}\n    >>> print(bg.boostedRanking[:10],' ... ',              bg.boostedRanking[-10:] )\n      [680, 389, 742, 152, 132, 276, 717, 604, 624, 181]  \n       ...  \n      [237, 681, 887, 879, 925, 970, 63, 714, 33, 313]\n\n    ";
